package main

import (
  "net/http"
  "encoding/base64"
  "strconv"
  "bytes"
  "log"
  "text/template"
  "io/ioutil"
  "encoding/json"
  "github.com/labstack/echo"
  "github.com/labstack/echo/middleware"
)

type  HttpConfig struct {
	Port string
	Path string
	Url string
}
type FILE struct {
  Path string
  Size string
  Date string
}
type DIR struct {
  Path string
}
type FileListInfo struct {
   Dirs  []DIR
   Files []FILE
}
var path string
var httpconfig HttpConfig
func main() {
   dat,err := ioutil.ReadFile("./config.json")
   if err != nil{
	   log.Println("No config.json. create default file")
	   httpconfig.Port = ":8080"
	   httpconfig.Path = "./"
	   httpconfig.Url = "/files/"
	   dat , err = json.Marshal(httpconfig)
	   ioutil.WriteFile("./config.json",dat,0777)
	   
   } else {
   json.Unmarshal(dat,&httpconfig)
   }

  path = httpconfig.Path
  // Echo instance
  e := echo.New()


  // Middleware
  e.Use(middleware.Logger())
  e.Use(middleware.Recover())

  log.Println("Port - ",httpconfig.Port)
  log.Println("Path - ",httpconfig.Path)

  e.Static(httpconfig.Url,httpconfig.Path)
  e.GET("main.css",maincss)
  e.GET("js/jquery.min.js",jquery)
  e.GET("js/jquery.ztree.all.min.js",ztree)
  e.GET("css/zTreeStyle.css",ztreestyle)
  e.GET("css/img/zTreeStandard.png",zpng)
  e.GET("demo",demo)
  e.GET("/",index)
  e.GET("api/listfile",apilistfile)

  //e.GET(httpconfig.Url,listfile)

  // Routes
  e.GET("/ping", hello)

  // Start server
  e.Logger.Fatal(e.Start(httpconfig.Port))
}
func apilistfile(c echo.Context) error {
      querypath := c.QueryParam("path")
      log.Println("api:list file,query path ",querypath)
      fileCtx := FileListInfo{}
      files, err := ioutil.ReadDir(httpconfig.Path+querypath) //limit dir
      //files, err := ioutil.ReadDir(c.Request().URL.Path)
          if err != nil {
		          log.Println(err)
			  return c.String(http.StatusOK,"{}")
	}
     for _, f:= range files {
	     if f.IsDir() {
	        fileCtx.Dirs = append(fileCtx.Dirs,DIR{Path: f.Name()})
    		} else {
			fileCtx.Files = append(fileCtx.Files,FILE{Path:f.Name(),Size: strconv.FormatInt(f.Size(),10)+" bytes",Date:f.ModTime().Format("2006-01-02 15:04:05")})}

     }
     dat , err := json.Marshal(fileCtx)
     return c.String(http.StatusOK,string(dat))
}
